INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('2d2cfb2b-df28-489e-8c1b-ebd7e3686dc6', '38b7c9e8-97f9-42f7-a4c6-5b7a936619a1', 'duFtdxGwvf.jpg', '外観', 'デッキ材を使った２階テラスの手摺の高さを高くして周囲から見えづらくしました。', 'f', '2017-09-26 16:10:41.054728', '2017-09-26 16:10:41.054728');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('ebe01297-45c7-4e59-b05f-e2920109e22d', '38b7c9e8-97f9-42f7-a4c6-5b7a936619a1', 'KHqdJYq06k.jpg', '2F_LDK', '中央部分の白い壁に囲まれた部分は屋上にある窓から自然光を１階に落す為のライトウェル（光井戸）です。２階はこの白い壁で空間をおおらかに分けています。', 'f', '2017-09-26 16:10:50.148613', '2017-09-26 16:10:50.148613');
