INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('fcb76a0e-6d25-4dff-943d-a956ab1adfbb', '303a6be7-3c4b-4205-be32-b7b1e6568130', 'VjgJ0DG5tA.jpg', 'リビングダイニング2', NULL, 'f', '2017-09-26 17:24:10.346964', '2017-09-26 17:24:10.346964');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('46c23cce-6b05-4162-9e70-5f4f5ed98a27', '303a6be7-3c4b-4205-be32-b7b1e6568130', 'N4KJ2xnQHD.jpg', 'リビングルーム', 'コンクリートのラフで力強い素材感を活かしたリビング空間です。床フローリングはオーストリア製最高級品のMafiの幅広・ロングフローリングを施主支給で現地に配達して貰っています。', 'f', '2017-09-26 17:24:15.591112', '2017-09-26 17:24:15.591112');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('70f0f85e-cf08-43d5-adf8-c61f5be1baf3', '303a6be7-3c4b-4205-be32-b7b1e6568130', 'VI8yG7CZ6V.jpg', 'キッチン', 'アイランドカウンター中央を貫通する丸柱は、既存の共用竪配管です。解体時に位置を確認してから、キッチンを設計し、二つのキャビネットとカウンターを作って、現地で配管を挟む形で合体させています', 'f', '2017-09-26 17:24:21.223969', '2017-09-26 17:24:21.223969');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('21cd117b-d03c-4bc3-9897-987e85628531', '303a6be7-3c4b-4205-be32-b7b1e6568130', '5TohFJU3DB.jpg', 'バス', '素っ気ないほどシンプルなモルタルで仕上げた浴室です。サイズ的な問題と他の部屋とのコストの掛け方の問題で、モルタル仕上げとしましたが、テンパーガラスの扉、カルデヴァイの浴槽、グローエの水栓類を使うことで、存在感のある浴室になりました', 'f', '2017-09-26 17:24:27.461923', '2017-09-26 17:24:27.461923');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('e2c6434c-feae-4fa5-bc58-d3218a33e02b', '303a6be7-3c4b-4205-be32-b7b1e6568130', 'XPWYMDN9fm.jpg', '洗面', NULL, 'f', '2017-09-26 17:24:34.298827', '2017-09-26 17:24:34.298827');
