INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('a198623a-b772-4a71-b2d4-3f603422dbd6', '0327723c-5425-4a2b-a90f-5903e679632e', 'FH8oMKiu49.jpg', '二世帯の共用エントランス', '二世帯共用のエントランス．法的な諸条件をクリアしつつ，限られた旗竿敷地を最大限利用するため，屋外としていますが，背の高い黒壁で囲い，背の高いゲートのような開口をくぐり抜けると白い壁とすることで，同じ家に入る感覚を演出しています．', 'f', '2017-09-26 18:10:04.182355', '2017-09-26 18:10:04.182355');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('1e43d41c-aa20-4b4d-8a3c-a916afd81d1c', '0327723c-5425-4a2b-a90f-5903e679632e', 'YGOeLQ5mTB.jpg', '旗竿側から見た外観', '旗竿敷地の二世帯共用エントランス．二世帯共用を象徴する大きな開口と，赤錆の鉄扉が印象的なファサードです．', 'f', '2017-09-26 18:10:12.551185', '2017-09-26 18:10:12.551185');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('6cd9f2be-aafc-41a7-a1e7-26e9d7719472', '0327723c-5425-4a2b-a90f-5903e679632e', '3Hg41QA3wV.jpg', '明るい一階のリビング', '親世帯が暮らすリビング．旗竿敷地の一階という条件の悪い中，南北にセミプライベートなテラスを取ることで，プライバシーを確保しつつ最大限の明るさと通風を確保しました．', 'f', '2017-09-26 18:10:19.995945', '2017-09-26 18:10:19.995945');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('417797e5-cb9e-436d-a1ec-ff5cca9edf18', '0327723c-5425-4a2b-a90f-5903e679632e', 'ZbnF4VAdq7.jpg', 'スキマの書斎', 'リビングからウォークインクローゼットに入る通路に設けられた書斎コーナー', 'f', '2017-09-26 18:10:24.669522', '2017-09-26 18:10:24.669522');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('f96d7267-60c1-4fc2-a24e-8e24e11a4938', '0327723c-5425-4a2b-a90f-5903e679632e', 'XFFSyV9vx7.jpg', '親子で光と風を共有する開口1', '南側のテラスの外側に建てられた壁には上下階の中央に1階分の高さで開口が開いています．旗竿敷地の中で光と風を最大限取り込みつつ，プライバシーを保つ役割を持っています．', 'f', '2017-09-26 18:10:33.497396', '2017-09-26 18:10:33.497396');
