INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('eed84e75-a76b-41cc-901e-31fc07d5f2df', '7b765951-38a9-4003-8d5c-972e1dde4718', 'o4TWQeIpi6.jpg', '可動本棚の家', '１０坪の空間最大限有効利用するために可動本棚や可動間仕切り、コアガリなどを使って、ワンルームから２LDKまで空間の間取りを変更出来る空間としました。', 'f', '2017-09-26 18:29:50.739944', '2017-09-26 18:29:50.739944');
