INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('125372ea-8456-423f-906f-4a9f4e5d9449', '7b765951-38a9-4003-8d5c-972e1dde4718', 'dcxLlMz4od.jpg', '可動本棚', '可動本棚はリビング側にブックディスプレイ、寝室側を本棚としています。潜戸は可動本棚をリビング側に引出し、寝室を作った時のアクセスに使用します。ワンルームとして大きく使いたい時は可動本棚を壁側に納めます。', 'f', '2017-09-26 18:30:05.450957', '2017-09-26 18:30:05.450957');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('3bbcc46c-5166-4533-8778-b17c57dc38fb', '7b765951-38a9-4003-8d5c-972e1dde4718', '66lQFThj75.jpg', '寝室', '可動本棚を全面に引出すことで、寝室を作ることが出来ます。寝室へは潜戸を使って入ることが出来ます。必要に応じて部屋をつくれるので空間を有効に利用することが出来ます。', 'f', '2017-09-26 18:30:12.717609', '2017-09-26 18:30:12.717609');
